pragma solidity ^0.4.24;

import "./dependencies/Types.sol";
import "./dependencies/LotteryStorage.sol";
import "./dependencies/Ownable.sol";
import "./dependencies/interfaces.sol";
import "./dependencies/ReentrancyGuard.sol";
import "./dependencies/SafeMath.sol";

/**
@title LotteryFactory
@notice Deploy a lottery contract
*/
contract LotteryFactory {
    uint public totalLotteries = 0; // count total lottery contract
    address public token;
    mapping (address => bool) public verifyLotteries;
    mapping (uint => address) public arrayLotteries;

    /**
    @notice constructor
    @param _token address of token contract
    */
    constructor(address _token) public {
        token = _token;
    }

    /**
    @notice Deploy a new lottery
    @param _ref address of referral contract
    */
    function deployLottery(address _ref, address _storage) public {
        address newLottery = new Lottery(token, _ref, _storage, msg.sender);
        verifyLotteries[newLottery] = true;
        arrayLotteries[totalLotteries] = newLottery;
        totalLotteries ++;
    }
}

/**
@title Lottery
@notice Lottery creation and process management
*/
contract Lottery is Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    using Types for *;

    mapping (uint8 => uint) public dataPrize; // 50 => 1000000, 41 => 50000, ......
    mapping (address => uint[]) public usersTickets;
    mapping (address => uint[]) public multiDrawsTickets;
    mapping (address => uint[]) public usersAllTickets;
    mapping (uint => Types.Ticket) public ticketNumbers;
    mapping (address => uint) public numEndDraws; // the number of the lottery in which the multidraw is not valid
    mapping (address => uint) public curDraws; // list users of current draws
    mapping (uint8 => uint) public dataDraws;
    mapping (uint8 => uint) public dataPowerPlay;
    mapping (uint => Types.Ticket) public listWinTicketDraws;
    address public lotteryManager;
    uint256 public jackpot;
    uint256 public bank;
    uint256 public countOfDraws; // number of running draws
    uint256 public startLotteryBlock; // after this block lottery get start
    uint256 public sellOverBlock; // after this block new tickets will not accepted
    uint256 public stopLotteryBlock; // before this block wiiner's tikcet must be choosen
    uint256 public closeLotteryBlock; // all players must get their reward before this block
    uint256 public blockForRandom;  //  this block will be use as a seed
    uint256 public numberOfTickets; // number of tickets of the current lottery
    uint256 public totalNumberOfTickets; // total number of tickets
    uint256 public totalWinners; // total number of winners
    uint256 public priceTicket;
    uint256 public idTicket;
    uint8 public multiplier; // coefficient for calculating winnings from a powerplay 
    bool public winTicketChoosen;
    bool public activeLottery;
    Types.Ticket public winTicket;
    ERC20Interface betToken;
    RefInterface referrer;
    LotteryStorage storageLottery;

    address[] jackpotWinners;

    modifier onlyOwnerOrLotteryManager() {
        require(msg.sender == owner || msg.sender == lotteryManager);
        _;
    }

    /// @dev Ticket access modifier
    modifier sellIsActive() {
        require(block.number < sellOverBlock);
        _;
    }

    /// @dev Access modifier for awarding
    modifier rewardAllowed() {
        require(winTicketChoosen && block.number < closeLotteryBlock);
        _;
    }

    /**
    @notice constructor
    @param _token Address of token contract
    @param _ref Address of referral contract
    @param _owner Address of operator
    */
    constructor(address _token, address _ref, address _storage, address _owner) public {
        owner = _owner;
        betToken = ERC20Interface(_token);
        referrer = RefInterface(_ref);
        storageLottery = LotteryStorage(_storage);
        priceTicket = 2 ether;
        dataPrize[50] = 1000000 ether; // 1/11,688,053.52
        dataPrize[41] = 50000 ether; // 1/913,129.18
        dataPrize[40] = 100 ether; // 1/36,525.17
        dataPrize[31] = 100 ether; // 1/14,494.11
        dataPrize[30] = 7 ether; // 1/579.76
        dataPrize[21] = 7 ether; // 1/701.33
        dataPrize[11] = 4 ether; // 1/91.98
        dataPrize[1] = 4 ether; // 1/38.32
        dataPrize[0] = 0;
        dataPowerPlay[0] = 1;
        dataPowerPlay[1] = 2;
        dataPowerPlay[2] = 3;
        dataPowerPlay[3] = 4;
        dataPowerPlay[4] = 5;
        dataPowerPlay[5] = 10;
        dataDraws[5] = 150;
        dataDraws[10] = 200;
        dataDraws[25] = 225;
        dataDraws[52] = 250;
    }

    /**
    @notice Start new lottery
    @param _sellOverBlock Before this block players can buy a ticket
    @param _stopLotteryBlock Before this block there must be a draw of balls
    @param _closeLotteryBlock Before this block players can pick up the reward
    */
    function createLottery(
        uint256 _sellOverBlock,
        uint256 _stopLotteryBlock,
        uint256 _closeLotteryBlock
    ) public onlyOwner
    {
        require(!activeLottery);
        //require(_sellOverBlock.add(249) < _stopLotteryBlock && _stopLotteryBlock.add(5952) < _closeLotteryBlock); // 5952 = 1 day
        //require(betToken.balanceOf(this) >= 40000000 ether); // for jackpot
        require(_sellOverBlock.add(29) < _stopLotteryBlock && _stopLotteryBlock.add(9) < _closeLotteryBlock); // for test
        require(betToken.balanceOf(this) >= 8 ether); // for test
        jackpot = betToken.balanceOf(this).sub(bank);
        activeLottery = true;
        winTicketChoosen = false;
        numberOfTickets = 0;
        countOfDraws = countOfDraws.add(1);
        sellOverBlock = _sellOverBlock;
        stopLotteryBlock = _stopLotteryBlock;
        closeLotteryBlock = _closeLotteryBlock;
        //blockForRandom = sellOverBlock.add(248); // 248 blocks = 1 hour
        blockForRandom = sellOverBlock.add(2); // for tests
        storageLottery.createLottery(countOfDraws, jackpot);
        uint16 rnd = uint16(keccak256(abi.encodePacked(block.number, msg.sender))) % 43; //  1- 10X, 2 - 5X, 3 - 4X, 13-3X, 24 - 2X

        if(rnd < 2 && jackpot < 150000000 ether){
            multiplier = 5;
        } else if (rnd < 4){
            multiplier = 4;
        } else if (rnd < 7){
            multiplier = 3;
        } else if (rnd < 20){
            multiplier = 2;
        } else {
            multiplier = 1;
        }
    }

    /**
    @notice Set manager
    @param _manager Address manager
    */
    function setManager(address _manager) public onlyOwner {
        lotteryManager = _manager;
    }

    /**
    @notice Buy ticket
    @param _numberOfTickets Number of tickets for purchase
    @param _tickets Array of tickets
    @param _powerplay Boolean powerplay
    */
    function buyTicket(uint8 _numberOfTickets, uint8[] _tickets, bool _powerplay) sellIsActive public {
        // delete old tickets of the previous drawing
        if(curDraws[msg.sender] < countOfDraws){
            delete usersTickets[msg.sender];
        }
        // user can not have more than 25 tickets for one draw
        require(usersTickets[msg.sender].length.add(multiDrawsTickets[msg.sender].length).add(uint(_numberOfTickets)) <= 25);
        uint tokenAmount = priceTicket.mul(uint(_numberOfTickets));
        if (_powerplay) {
            tokenAmount = tokenAmount.add(priceTicket.mul(uint(_numberOfTickets)).div(2));
        }
        require(betToken.allowance(msg.sender, this) >= tokenAmount);
        require(betToken.transferFrom(msg.sender, this, tokenAmount));
        curDraws[msg.sender] = countOfDraws;

        address ref = checkReferrer(msg.sender);
        if(ref != 0){
            // 16% of the ticket price is sent to the referee for the fact that he brought the player
            uint256 rewardRef = tokenAmount.mul(160).div(1000);
            betToken.transfer(ref, rewardRef);
            tokenAmount = tokenAmount.sub(rewardRef);
        }

        storageLottery.addTicketsToDraw(countOfDraws, _numberOfTickets, 1);
        bank = bank.add(tokenAmount);
        numberOfTickets = numberOfTickets.add(uint(_numberOfTickets));
        totalNumberOfTickets = totalNumberOfTickets.add(uint(_numberOfTickets));
        // add tickets to the player
        for (uint8 i = 0; i < uint(_numberOfTickets) * 6; i += 6) {
            require((_tickets[i] <= 69 && _tickets[i] >= 0) &&
            (_tickets[i+1] <= 69 && _tickets[i+1] >= 0) &&
            (_tickets[i+2] <= 69 && _tickets[i+2] >= 0) &&
            (_tickets[i+3] <= 69 && _tickets[i+3] >= 0) &&
            (_tickets[i+4] <= 69 && _tickets[i+4] >= 0) &&
            (_tickets[i+5] <= 26 && _tickets[i+5] >= 0));
            /*require((_tickets[i] != _tickets[i+1]) && (_tickets[i] != _tickets[i+2]) && 
            (_tickets[i] != _tickets[i+3]) && (_tickets[i] != _tickets[i+4]) && 
            (_tickets[i+1] != _tickets[i+2]) && (_tickets[i+1] != _tickets[i+3]) && 
            (_tickets[i+1] != _tickets[i+4]) && (_tickets[i+2] != _tickets[i+3]) && 
            (_tickets[i+2] != _tickets[i+4]) && (_tickets[i+3] != _tickets[i+4]));*/

            ticketNumbers[idTicket] = Types.Ticket(_tickets[i],
            _tickets[i+1],
            _tickets[i+2],
            _tickets[i+3],
            _tickets[i+4],
            _tickets[i+5],
            _powerplay);

            usersTickets[msg.sender].push(idTicket);
            usersAllTickets[msg.sender].push(idTicket);
            storageLottery.buyTicketToDraw(countOfDraws, idTicket, msg.sender);
            idTicket = idTicket.add(1);
        }
    }

    /**
    @notice Buy tickets for multi-draw
    @param _numberOfTickets Number of tickets for purchase
    @param _tickets Array of tickets
    @param _powerplay Boolean powerplay
    @param _numDraws Number of drawings
    */
    function buyMultidraw(uint8 _numberOfTickets, uint8[] _tickets, bool _powerplay, uint8 _numDraws) public {
        // the user can not buy tickets if he has already bought for several drawings and they are not yet completed
        require(numEndDraws[msg.sender] < countOfDraws || (numEndDraws[msg.sender] == 0 && countOfDraws == 0));
        require(_numberOfTickets <= 5);
        require(_numDraws == 5 || _numDraws == 10 || _numDraws == 25 || _numDraws == 52);
        // delete old tickets of the previous drawings
        delete multiDrawsTickets[msg.sender];
        // remember before which draw bought tickets
        numEndDraws[msg.sender] = countOfDraws.add(_numDraws);
        uint tokenAmount = priceTicket.mul(uint(_numberOfTickets));
        if (_powerplay) {
            tokenAmount = tokenAmount.add(priceTicket.mul(uint(_numberOfTickets)).div(2));
        }
        tokenAmount = tokenAmount.mul(uint256(_numDraws));
        tokenAmount = tokenAmount.sub(tokenAmount.mul(dataDraws[_numDraws]).div(1000));
        require(betToken.allowance(msg.sender, this) >= tokenAmount);
        require(betToken.transferFrom(msg.sender, this, tokenAmount));

        address ref = checkReferrer(msg.sender);
        if(ref != 0){
            // 16% of the ticket price is sent to the referee for the fact that he brought the player
            uint256 rewardRef = tokenAmount.mul(160).div(1000);
            betToken.transfer(ref, rewardRef);
            tokenAmount = tokenAmount.sub(rewardRef);
        }

        storageLottery.addTicketsToDraw(countOfDraws, _numberOfTickets, _numDraws);

        bank = bank.add(tokenAmount);
        totalNumberOfTickets = totalNumberOfTickets.add(uint(_numberOfTickets));
        // add tickets to the player
        for (uint8 i = 0; i < uint(_numberOfTickets) * 6; i += 6) {
            require((_tickets[i] <= 69 && _tickets[i] >= 0) &&
            (_tickets[i+1] <= 69 && _tickets[i+1] >= 0) &&
            (_tickets[i+2] <= 69 && _tickets[i+2] >= 0) &&
            (_tickets[i+3] <= 69 && _tickets[i+3] >= 0) &&
            (_tickets[i+4] <= 69 && _tickets[i+4] >= 0) &&
            (_tickets[i+5] <= 26 && _tickets[i+5] >= 0));
            /*require((_tickets[i] != _tickets[i+1]) && (_tickets[i] != _tickets[i+2]) && 
            (_tickets[i] != _tickets[i+3]) && (_tickets[i] != _tickets[i+4]) && 
            (_tickets[i+1] != _tickets[i+2]) && (_tickets[i+1] != _tickets[i+3]) && 
            (_tickets[i+1] != _tickets[i+4]) && (_tickets[i+2] != _tickets[i+3]) && 
            (_tickets[i+2] != _tickets[i+4]) && (_tickets[i+3] != _tickets[i+4]));*/

            ticketNumbers[idTicket] = Types.Ticket(_tickets[i],
            _tickets[i+1],
            _tickets[i+2],
            _tickets[i+3],
            _tickets[i+4],
            _tickets[i+5],
            _powerplay);

            multiDrawsTickets[msg.sender].push(idTicket);
            usersAllTickets[msg.sender].push(idTicket);
            storageLottery.buyTicketToDraw(countOfDraws, idTicket, msg.sender);
            idTicket = idTicket.add(1);
        }
    }

    /**
    @notice Player check for the referral
    @param player Address of player
    @return {
        "_referrer": "The referrer address to receive a reward"
    }
    */
    function checkReferrer(address player) view private returns (address _referrer) {
        (, _referrer) = referrer.getService(player);
        return _referrer;
    }

    /**
    @notice Get random number
    @param upper The maximum value of a random number
    @param _blockForRandom Value for generate random number
    @return randomNumber Random number
    */
    function random(uint8 upper, uint256 _blockForRandom) view internal returns (uint8 randomNumber) { // must be internal
        randomNumber = uint8(keccak256(abi.encodePacked(blockhash(_blockForRandom))));
        return randomNumber % upper + 1;
    }

    /**
    @notice Choose a winning ticket
    */
    function chooseWinTicket() public {
        require(block.number > blockForRandom && block.number < (blockForRandom + 255) && winTicketChoosen == false);
        require(activeLottery);
        uint8[5] memory arRnd;
        uint8 count = 0;
        uint8 seed = 0;

        while(count < 5){
            uint8 rnd = random(69, blockForRandom - count - seed - 1);

            if(indexOf(arRnd, rnd) == 0){
                arRnd[count] = rnd;
                count ++;
            } else {
                seed ++;
            }
        }
        winTicket.wb1 = arRnd[0];
        winTicket.wb2 = arRnd[1];
        winTicket.wb3 = arRnd[2];
        winTicket.wb4 = arRnd[3];
        winTicket.wb5 = arRnd[4];
        winTicket.rb = random(26, blockForRandom-1);
        winTicketChoosen = true;

        listWinTicketDraws[countOfDraws] = winTicket;
    }

    /**
    @notice Searches for an item in an array by using strict equality (===) and returns the index position of the item
    @param array Array that we sort through
    @param value The value we are looking for in the array
    @return uint Returns the integer index of an element within an array, or 0 if the element is not in the array
    */
    function indexOf(uint8[5] array, uint8 value) pure internal returns(uint) {
        for (uint8 i = 0; i < array.length; i++) {
            if (array[i] == value) {
                return i+1;
            }
        }
        return 0;
    }

    /**
    @notice A player can return money for tickets if the draw has not taken place
    */
    function refund() public nonReentrant {
        require(usersTickets[msg.sender].length > 0 || multiDrawsTickets[msg.sender].length > 0);
        require(block.number > stopLotteryBlock && winTicketChoosen == false && activeLottery == true);
        require(curDraws[msg.sender] == countOfDraws || numEndDraws[msg.sender] >= countOfDraws);

        Types.Ticket memory _ticket;
        uint8 drawsLength = uint8(multiDrawsTickets[msg.sender].length);
        bool multidraws = (numEndDraws[msg.sender] >= countOfDraws);
        if(multidraws) {
            numEndDraws[msg.sender] ++;
        } else {
            drawsLength = 0;
        }
        uint8 ticketLength = uint8(usersTickets[msg.sender].length);
        uint valueToRefund;

        for (uint8 i = 0; i < ticketLength; i++) {
            _ticket = ticketNumbers[usersTickets[msg.sender][i]];

            valueToRefund = valueToRefund.add(priceTicket);
            if (_ticket.pp) {
                valueToRefund = valueToRefund.add((priceTicket).div(2));
            }
        }

        delete usersTickets[msg.sender];
        betToken.transfer(msg.sender, valueToRefund);
    }

    /**
    @notice Checking the ticket at the address for the win
    @param player Address of player
    @return {
        "count": "An array containing two elements. The amount of money won. Jackpot"
    }
    */
    function checkMyTicket(address player) public view returns(uint256[3]) {
        require(winTicketChoosen);
        uint256[3] memory count;
        count[0] = 0; // reward
        count[1] = 0; // jackpot
        count[2] = 0; // win tickets
        uint8[5] memory arRnd;
        arRnd[0] = winTicket.wb1;
        arRnd[1] = winTicket.wb2;
        arRnd[2] = winTicket.wb3;
        arRnd[3] = winTicket.wb4;
        arRnd[4] = winTicket.wb5;
        Types.Ticket memory _ticket;
        uint8[2] memory tagReward;
        tagReward[0] = 0; // wbCount
        tagReward[1] = 0; // rbGlobal
        uint profitReward;
        uint8 drawsLength = uint8(multiDrawsTickets[player].length); //5
        if(!(numEndDraws[player] >= countOfDraws)) {
            drawsLength = 0;
        }
        uint8 ticketLength = uint8(usersTickets[player].length);//0
        uint8 countTicket = ticketLength + drawsLength;
        uint id = 0;

        for (uint8 i = 0; i < countTicket; i++) {
            if(countTicket > drawsLength && (numEndDraws[player] >= countOfDraws) == true){
                if(i >= ticketLength) {
                    id = multiDrawsTickets[player][i-ticketLength];
                } else {
                    id = usersTickets[player][i];
                }
            } else if(drawsLength > 0 && (numEndDraws[player] >= countOfDraws) == true){
                id = multiDrawsTickets[player][i];
            } else {
                id = usersTickets[player][i];
            }
            _ticket = ticketNumbers[id];

            tagReward[0] = 0;
            tagReward[1] = 0;
            profitReward = 0;

            if(indexOf(arRnd, _ticket.wb1) > 0){
                tagReward[0] ++;
            }
            if(indexOf(arRnd, _ticket.wb2) > 0){
                tagReward[0] ++;
            }
            if(indexOf(arRnd, _ticket.wb3) > 0){
                tagReward[0] ++;
            }
            if(indexOf(arRnd, _ticket.wb4) > 0){
                tagReward[0] ++;
            }
            if(indexOf(arRnd, _ticket.wb5) > 0){
                tagReward[0] ++;
            }

            if (_ticket.rb == winTicket.rb) {
                tagReward[1] = 1;
            }
            uint8 category = tagReward[0] * 10 + tagReward[1];

            if (category == 51) {
                count[1] = 1; // jackpot
                count[2] ++;
            } else if (_ticket.pp && category == 50) {
                count[0] = count[0] + dataPrize[50].mul(2); // match 5 + powerplay
                count[2] ++;
            } else if (_ticket.pp) {
                count[0] = count[0].add(dataPrize[category] * dataPowerPlay[multiplier]); // powerplay
                profitReward = dataPrize[category] * dataPowerPlay[multiplier];
            } else {
                count[0] = count[0].add(dataPrize[category]);
                profitReward = dataPrize[category];
            }

            if(profitReward > 0){
                count[2] ++;
            }
        }
        return count;
    }

    /**
    @notice The player receives a reward for all tickets of the current lottery
    */
    function getReward() public nonReentrant rewardAllowed {
        require(usersTickets[msg.sender].length > 0 || multiDrawsTickets[msg.sender].length > 0);
        if(curDraws[msg.sender] < countOfDraws){
            delete usersTickets[msg.sender];
        }
        bool multidraws = (numEndDraws[msg.sender] >= countOfDraws);
        if(!multidraws) {
            // delete old tickets of the previous drawings  
            delete multiDrawsTickets[msg.sender];
        }
        uint256 reward;
        uint256 jack;
        //uint256 winTickets;
        uint256[3] memory count = checkMyTicket(msg.sender);
        reward = count[0];
        jack = count[1];
        //winTickets = count[2];
        storageLottery.addWinTickets(countOfDraws, count[2]);
        storageLottery.addUserRewards(totalWinners, reward, msg.sender);
        totalWinners = totalWinners.add(1);

        delete usersTickets[msg.sender];
        if (jack == 1) {
            jackpotWinners.push(msg.sender);
        } else if (reward > 0) {
            betToken.transfer(msg.sender, reward);
        }
    }

    /**
    @notice Close lottery. Players can not pick up the reward after this time.
    */
    function closeLottery() public nonReentrant {
        require(closeLotteryBlock < block.number);
        require(activeLottery);
        uint256 tokenAmount = betToken.balanceOf(this);
        serviceReward(tokenAmount);
        startLotteryBlock = closeLotteryBlock.add(5);
        activeLottery = false;
    }

    /**
    @notice Get length tickets
    @param _player Address of player
    @return uint256 length
    */
    function getLengthTickets(address _player) public view returns(uint256) {
        return usersTickets[_player].length;
    }

    /**
    @notice Get length multi-draws tickets
    @param _player Address of player
    @return uint256 length
    */
    function getLengthMultiDrawsTickets(address _player) public view returns(uint256) {
        return multiDrawsTickets[_player].length;
    }

    /**
    @notice Get length multi-draws tickets
    @param _player Address of player
    @return uint256 length
    */
    function getLengthAllTickets(address _player) public view returns(uint256) {
        return usersAllTickets[_player].length;
    }

    /**
    @notice Pay Jackpot
    @param _to Address of player
    @param _value Amount BET
    */
    function payJackpot(address _to, uint256 _value) private {
        betToken.transfer(_to, _value);
    }

    /**
    @notice Distribution of earned tokens for draw
    @param _value Amount BET
    */
    function serviceReward(uint256 _value) internal {
        if (jackpot > _value) {
            jackpot = _value; // Jackpot can not exceed the balance of the contract
        }

        uint256 jackpotValue;
        uint profit = _value.sub(jackpot);

        if (jackpotWinners.length > 0) {
            //listWinnersDraws[countOfDraws] = listWinnersDraws[countOfDraws].add(jackpotWinners.length);
            storageLottery.addWinTickets(countOfDraws, jackpotWinners.length);
            jackpotValue = jackpot.div(jackpotWinners.length);
            for (uint256 i = 0; i < jackpotWinners.length; i++) {
                payJackpot(jackpotWinners[i], jackpotValue);
            }
            jackpot = 0;
        }

        uint256 valueForBank = profit.mul(420).div(1000); // 42 % for bank
        uint256 valueForJackpot = profit.mul(420).div(1000); // 42 % for Jackpot
        uint256 valueForOwner = profit.mul(160).div(1000); // 16 % for owner

        betToken.transfer(owner, valueForOwner);
        jackpot = jackpot.add(valueForJackpot);
        bank = valueForBank;
    }

    /**
    @notice Set price ticket
    @param price Price for ticket
    */
    function setPriceTicket(uint price) public onlyOwnerOrLotteryManager {
        require(!activeLottery);
        priceTicket = price;
    }

    /**
    @notice Set data prize
    @param data Data array
    */
    function setDataPrize(uint[] data) public onlyOwnerOrLotteryManager {
        require(!activeLottery);
        dataPrize[50] = data[4]; // 1/11,688,053.52
        dataPrize[41] = data[3]; // 1/913,129.18
        dataPrize[40] = data[2]; // 1/36,525.17
        dataPrize[31] = data[2]; // 1/14,494.11
        dataPrize[30] = data[1]; // 1/579.76
        dataPrize[21] = data[1]; // 1/701.33
        dataPrize[11] = data[0]; // 1/91.98
        dataPrize[1] = data[0]; // 1/38.32
    }

    /*
    function withdraw() public onlyOwner {
        require(!activeLottery);
        betToken.transfer(msg.sender, betToken.balanceOf(this));
        bank = 0;
        jackpot = 0;
    }*/

    // only for tests
    function setWinTicket(
        uint8 wb1, 
        uint8 wb2,
        uint8 wb3,
        uint8 wb4,
        uint8 wb5,
        uint8 rb) public onlyOwnerOrLotteryManager {
        winTicket.wb1 = wb1;
        winTicket.wb2 = wb2;
